import React, { useState } from 'react';
import { RiMenu3Line, RiCloseLin } from 'react-icons/ri'
import './navbar.css'
import logo from '../../assets/logo.svg'

const Navbar = () => {
    const [toggleMenu, setToggleMenu] = useState(false)
    return (
        <div className='gtp3__navbar'>
            <div className='gpt3__navbar-links'>
                <div className='gpt3__logo-navbar'>
                    <img src={logo} alt="" />
                </div>
                <div className='gpt3__navbar-links_container'>
                    <p><a href="#">Home</a></p>
                    <p><a href="#">What GTP3 is ?</a></p>
                    <p><a href="#">Open AI</a></p>
                    <p><a href="#">Case studies</a></p>
                    <p><a href="#">Library</a></p>
                </div>
            </div>
            <div className='gpt3__navbar-signin'>
                <p>Sign In</p>
                <button type="button">Sign Up</button>
            </div>
            <div className='gpt3__navbar-menu'>
                {
                    toggleMenu ?
                    <RiCloseLin color="#fff" size={27} onClick={ () => setToggleMenu(false) } /> : 
                    <RiMenu3Line color="#fff" size={27} onClick={() => setToggleMenu(true)} />
                }
            </div>
        </div>
    );
};

export default Navbar;
